import React from 'react';
import { motion } from 'framer-motion';
import './Footer.css';

const Footer = ({ onNavigate }) => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <motion.div
            className="footer-section"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            viewport={{ once: true }}
          >
            <h3>üå± Smart Ecodispose</h3>
            <p>Making sustainable choices easy for everyone. Together, we can reduce contamination and promote recycling.</p>
            <div className="social-links">
              <motion.a
                href="#"
                whileHover={{ scale: 1.2, rotate: 5 }}
                whileTap={{ scale: 0.9 }}
              >
                üìò
              </motion.a>
              <motion.a
                href="#"
                whileHover={{ scale: 1.2, rotate: 5 }}
                whileTap={{ scale: 0.9 }}
              >
                üê¶
              </motion.a>
              <motion.a
                href="#"
                whileHover={{ scale: 1.2, rotate: 5 }}
                whileTap={{ scale: 0.9 }}
              >
                üì∑
              </motion.a>
              <motion.a
                href="#"
                whileHover={{ scale: 1.2, rotate: 5 }}
                whileTap={{ scale: 0.9 }}
              >
                üíº
              </motion.a>
            </div>
          </motion.div>

          <motion.div
            className="footer-section"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.1 }}
            viewport={{ once: true }}
          >
            <h4>Quick Links</h4>
            <ul>
              <li>
                <motion.button
                  onClick={() => onNavigate('home')}
                  whileHover={{ x: 5 }}
                  transition={{ duration: 0.2 }}
                >
                  üè† Home
                </motion.button>
              </li>
              <li>
                <motion.button
                  onClick={() => onNavigate('identification')}
                  whileHover={{ x: 5 }}
                  transition={{ duration: 0.2 }}
                >
                  üîç Identify Waste
                </motion.button>
              </li>
              <li>
                <motion.button
                  onClick={() => onNavigate('local-rules')}
                  whileHover={{ x: 5 }}
                  transition={{ duration: 0.2 }}
                >
                  üìã Local Rules
                </motion.button>
              </li>
              <li>
                <motion.button
                  onClick={() => onNavigate('upcycling')}
                  whileHover={{ x: 5 }}
                  transition={{ duration: 0.2 }}
                >
                  ‚ôªÔ∏è Upcycling Ideas
                </motion.button>
              </li>
            </ul>
          </motion.div>

          <motion.div
            className="footer-section"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            viewport={{ once: true }}
          >
            <h4>Contact Us</h4>
            <p>üìß support@smartecodispose.com</p>
            <p>üìû +91 9117204120</p>
            <p>üìç Making the world greener, one disposal at a time</p>
          </motion.div>
        </div>

        <motion.div
          className="footer-bottom"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.3 }}
          viewport={{ once: true }}
        >
          <p>&copy; 2025 Smart Ecodispose. All rights reserved. Built with üíö for a sustainable future.</p>
        </motion.div>
      </div>
    </footer>
  );
};

export default Footer;
